import React, { useState } from 'react'
import { makeStyles } from '@material-ui/core/styles'
import Typography from '@material-ui/core/Typography'
import Slider from '@material-ui/core/Slider'
import Grid from '@material-ui/core/Grid'
import { createOptionsEvaluation } from '~/redux/actions'
import { useDispatch } from 'react-redux'
import { useBetween } from 'use-between'
import { useSelector } from 'react-redux'

const useStyles = makeStyles({
  root: {
    width: 1500,
  },
})

const marks = [
  {
    value: -3,
    label: 'Biraz',
  },
  {
    value: -5,
    label: 'Oldukça',
  },
  {
    value: -7,
    label: 'Çok',
  },
  {
    value: -9,
    label: 'Son Derece',
  },
  {
    value: 0,
    label: 'Eşit',
  },
  {
    value: 3,
    label: 'Biraz',
  },
  {
    value: 5,
    label: 'Oldukça',
  },
  {
    value: 7,
    label: 'Çok',
  },
  {
    value: 9,
    label: 'Son Derece',
  },
]

const useFormState = () => {
  const [state, setState] = useState({
    results: [{ sname: '', value: null }],
  })

  return {
    state,
    setState,
  }
}

// Make a custom hook for sharing your state between any components
const useSharedFormState = () => useBetween(useFormState)

const Btn = () => {
  const { combinedOptions, athleteId } = useSelector(
    (state) => state.athleteCriteria,
  )

  const dispatch = useDispatch()
  const { state } = useSharedFormState()

  const handleSubmit = (event) => {
    event.preventDefault()

    const optionValues = combinedOptions.map((m, index) =>
      state.results[state.results.findIndex((obj) => obj.sname === index)] ==
      undefined
        ? {
            Option1Id: m.option1Id,
            Option2Id: m.option2Id,
            CriteriaId: m.criteriaId,
            Value: 0,
          }
        : {
            Option1Id: m.option1Id,
            Option2Id: m.option2Id,
            CriteriaId: m.criteriaId,
            Value:
              state.results[
                state.results.findIndex((obj) => obj.sname === index)
              ].value,
          },
    )

    const optionsEvaluation = Object.assign(
      {},
      {
        athleteId: athleteId,
        optionValues: optionValues,
      },
    )
    dispatch(createOptionsEvaluation(optionsEvaluation))
  }

  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        bottom: 50,
      }}
    >
      <button onClick={handleSubmit} className="button">
        Onayla
      </button>
    </div>
  )
}

const OptionPairComparison = (criteria, option1, option2, index) => {
  const classes = useStyles()
  const { state, setState } = useSharedFormState()
  const { scenario } = useSelector((state) => state.athlete)

  const valuetext = (value) => {
    return `${value}`
  }

  const optionName = (option1) => {
    if (scenario == 'Senaryo1') {
      if (option1 == 'Düşük veya yüksek performans ile spora dönüş')
        return <b>Ağrı kesici ile müsabakaya katılmak</b>
      else if (option1 == 'Hareket kısıtlaması ile antrenmanlara katılım') {
        return <b>Müsabakadan çekilip omuz askısı ile antrenmanlara katılmak</b>
      } else if (option1 == 'Spor yapmaya hazır değil') {
        return <b>Müsabakadan çekilip iyileşmeyi beklemek</b>
      }
    } else if (scenario == 'Senaryo2') {
      if (option1 == 'Düşük veya yüksek performans ile spora dönüş')
        return <b>Düşük performans ile sezonda oynamak</b>
      else if (option1 == 'Hareket kısıtlaması ile antrenmanlara katılım') {
        return (
          <b>Hareket kısıtlaması ile sadece kulüp antrenmanlarına katılmak</b>
        )
      } else if (option1 == 'Spor yapmaya hazır değil') {
        return <b>Sezonu pas geçip, gelecek sezona hazırlanmak</b>
      }
    }
  }

  const handleChange = (name) => (event, newValue) => {
    let list
    list = { sname: name, value: newValue }
    console.log(name)
    var index = state.results.findIndex((x) => x.sname === name)

    if (index === -1) setState({ results: [...state.results, list] })
    else {
      setState(({ results }) => ({
        results: [
          ...results.slice(0, index),
          {
            ...results[index],
            value: newValue,
          },
          ...results.slice(index + 1),
        ],
      }))
    }
  }

  return (
    <div className={classes.root}>
      <Typography id="discrete-slider" gutterBottom>
        <i>Kriter: {criteria}</i>
      </Typography>
      <Grid container spacing={4}>
        <Grid item>{optionName(option1)}</Grid>
        <Grid item xs>
          <Slider
            defaultValue={0}
            getAriaValueText={valuetext}
            onChange={handleChange(index)}
            aria-labelledby="discrete-slider"
            //valueLabelDisplay="auto"
            track={false}
            step={null}
            marks={marks}
            min={-9}
            max={9}
          />
        </Grid>
        <Grid item>{optionName(option2)}</Grid>
      </Grid>
    </div>
  )
}

export { OptionPairComparison, Btn }
